import React, { useEffect } from "react";

function AlbumList({ user = {}, albums }) {
  if (Object.entries(user).length !== 0) {
    return (
      <ol>
        {albums.map((album) => (
          <li key={album.id}>
            {album.id} - {album.title}
          </li>
        ))}
      </ol>
    );
  }
  return <p>Please click on a user name to the left</p>;
}

export default AlbumList;
